import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './CreateAnimalPage.css';

const CreateAnimalPage = () => {
    const [name, setName] = useState('');
    const [species, setSpecies] = useState('');
    const [birthDate, setBirthDate] = useState('');
    const [caretaker, setCaretaker] = useState('');
    const [habitat, setHabitat] = useState('');
    const navigate = useNavigate();

    const handleCreate = () => {
        console.log('Animal creado:', { name, species, birthDate, caretaker, habitat });
    };

    return (
        <div className="create-container">
            <h1 className="create-title">INGRESE LOS DATOS DEL ANIMAL</h1>
            <form className="create-form">
                <div className="form-group">
                    <label htmlFor="name">Nombre:</label>
                    <input
                        type="text"
                        id="name"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="species">Especie:</label>
                    <input
                        type="text"
                        id="species"
                        value={species}
                        onChange={(e) => setSpecies(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="birthDate">Fecha de nacimiento:</label>
                    <input
                        type="date"
                        id="birthDate"
                        value={birthDate}
                        onChange={(e) => setBirthDate(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="caretaker">Cuidador:</label>
                    <input
                        type="text"
                        id="caretaker"
                        value={caretaker}
                        onChange={(e) => setCaretaker(e.target.value)}
                        required
                    />
                </div>
                <div className="form-group">
                    <label htmlFor="habitat">Hábitat:</label>
                    <input
                        type="text"
                        id="habitat"
                        value={habitat}
                        onChange={(e) => setHabitat(e.target.value)}
                        required
                    />
                </div>
                <div className="button-container">
                    <button type="button" className="submit-button" onClick={handleCreate}>
                        Crear
                    </button>
                    <button type="button" className="back-button" onClick={() => navigate('/')}>
                        Atrás
                    </button>
                </div>
            </form>
        </div>
    );
};

export default CreateAnimalPage;
